import React, { useEffect,useState } from 'react'
import { Container, Button, } from 'react-bootstrap';
import { useParams } from 'react-router-dom';

const ViewOne = () => {
    const [getuserdata, setuserdata] = useState()
console.log(getuserdata)

    const {searctItem}=useParams("")
    console.log(searctItem);

    const getuser = async (e) => {
        const res = await fetch(`http://localhost:8000/getuser${searctItem}`, {
            method: "GET",
            headers: {
                "Content-Type": "application/json"
            },
        })
        const data = await res.json();
        console.log(data);

        if (res.status === 422 || !data) {
            alert('Not Exist')
        }
        else {
            setuserdata(data)
            console.log('data got')
        }
    }

useEffect(()=>{
getuser();
},[])

  return (
    <Container className='mt-5' style={{ width: 700 }}>
    <Form >
        <Form.Group className="mb-5" controlId="formBasicEmail">
            <Form.Control
                type="text"
                placeholder="Title"
                
            />
        </Form.Group>

        <Form.Group className="mb-5" >
            <textarea
                className="form-control"
                rows="5" >
            </textarea>
        </Form.Group>
        <div className="text-center">
            <Button variant="primary" type="submit" className="mb-5 form-control">
                Go Back
            </Button>
        </div>
    </Form>
</Container>
  )
}

export default ViewOne
